import React from "react";

const Projects = (props) => {
  const { projects } = props;
  return (
    <div className="projects">
      <div className="row justify-content-center">
        <div className="col-md-6">
        <div class="card">
                        <figure class="front">
                            <a href="http://www.friesandketchup.com/index"><img src="pics/friesthumb.png" class="card-img-top" alt="" /></a>
                        </figure>
                        <figure class="back">
                            <a href="http://www.friesandketchup.com/index">
                                <h3>Fries and Ketchup</h3>
                                <p>A Gaming Community website that I created, designed, and implemented.</p>
                            </a>
                        </figure>
                    </div> 
        </div>
        <div className="col-md-6">
          <h4 id="projectHeader">Projects</h4>
        </div>
      </div>
    </div>
  );
};

export default Projects;
